(function ( $ ) {

  $.fn.foundationSelect = function() {

    // Check to see if custom dropdowns have already been drawn
    if (!$('.custom-dropdown-area').length) {

      // If custom dropdowns haven't been drawn, build and insert them
      return this.each(function () {
        selectPrompt = '';
        selected = '';
        translateClasses = '';
        select = $(this);
        selectId = select.attr('id');
        multiple = false;
        multiple = select.prop('multiple') ? true : false;
        options = '';
        if (select.data('prompt')) {
          selectPrompt = '<span class="default-label">' + select.data('prompt') + '</span>';
          options = '<li class="disabled">' + selectPrompt + '</li>';
        } else {
          selectPrompt = 'Choose...';
        }
        select.find('option').each( function () {
          if ($(this).attr('selected')) {
            selected = 'selected';
            selectPrompt = "<div class='" + $(this).attr('class') + "'>" + $(this).html() + "</div>";
          }
          if( $(this).attr('class') ) {
            translateClasses = $(this).attr('class') + ' ';
          }
          options += '<li data-value="' + this.value + '" class="' + translateClasses + selected + '"><span class="option-title">' + $(this).html() + '</span></li>';
          selected = '';
        });
        newButton = '<div class="custom-dropdown-area" data-orig-select="#' + selectId + '"' + (multiple ? ' data-multiple="true"' : '') + '><a href="#" data-dropdown="select-' + selectId + '" class="custom-dropdown-button">' + selectPrompt + '</a> \
        <ul id="select-' + selectId + '" class="f-dropdown custom-dropdown-options" data-dropdown-content> \
          ' + options + ' \
        </ul></div>';
        select.hide();
        select.after(newButton);
      });
    };
  };

  // setup a listener to deal with custom dropdown clicks.
  $(document).on('click', '.custom-dropdown-area li', function () {
    if ($(this).hasClass('disabled')) {
      return false;
    }
    dropdown = $(this).closest('.custom-dropdown-area');
    multiple = dropdown.data('multiple') ? true : false;
    text = "<div class='" + $(this).attr('class') + "'>" + $(this).find('.option-title').html() + "</div>";
    value = $(this).data('value');
    totalOptions = dropdown.find('li').not('.disabled').length;
    origDropdown = $(dropdown.data('orig-select'));
    prompt = origDropdown.data('prompt') ? origDropdown.data('prompt') : 'Choose...';
    if (multiple) {
      $(this).toggleClass('selected');
      selectedOptions = [];
      selectedTitles = [];
      dropdown.find('.selected').each( function () {
        selectedOptions.push($(this).data('value'));
        selectedTitles.push($(this).find('.option-title').html());
      });
      origDropdown.val(selectedOptions);
      if (selectedOptions.length) {
        if (selectedOptions.length > 2) {
          dropdown.find('.custom-dropdown-button').html(selectedOptions.length + ' of ' + totalOptions + ' selected');
        }else{
          dropdown.find('.custom-dropdown-button').html(selectedTitles.join(', '));
        }
      }else{
        dropdown.find('.custom-dropdown-button').html(prompt);
      }
    }else{
      dropdown.find('li').removeClass('selected');
      Foundation.libs.dropdown.close($('#'+dropdown.find('ul').attr('id')));
      origDropdown.val(value);
      $(this).toggleClass('selected');
      dropdown.find('.custom-dropdown-button').html(text);
    }
  });

  $(document).on('reset', 'form', function () {
    if ($(this).children('.custom-dropdown-area').length) {
      $(this).find('.custom-dropdown-area').each( function () {
        origDropdown = $($(this).data('orig-select'));
        dropdown = $(this);
        multiple = dropdown.data('multiple') ? true : false;
        dropdown.find('li').removeClass('selected');
        if (origDropdown.data('prompt')) {
          prompt = origDropdown.data('prompt');
        }else{
          origDropdown.find('option').each( function () {
            if ($(this).attr('selected')) {
              prompt = $(this).html();
              dropdown.find('li[data-value="' + this.value + '"]').addClass('selected');
            }
          });
          if (prompt == '') {
            prompt = 'Choose...';
          }
        }
        dropdown.find('.custom-dropdown-button').html(prompt);
      });
    }
  });

}( jQuery ));
$(document).ready(function(){
	$(".remote .new_legacy_legacy_site, .edit_legacy_legacy_site").on("submit",function(e){ 
	
		e.preventDefault();
		e.stopImmediatePropagation();
		$('.error, .alert-box').remove();
		var errorList = getErrors();
		if (errorList.length == 0){
	  		$.ajax({
			  	type: "POST",
			  	url: this.action,
			  	data: $( this ).serialize(),
			  	success: function(data){
				  		
				  		if (data["id"] == undefined && data["updated"] == undefined){
					  		var html = "<div data-alert class='alert-box'>"+data+"<a href='#' class='close'>&times;</a></div>"
					  	 	$('form').prepend(html);
					  	 	$('.close').click(function(){
					  	 		$('.alert-box').remove();
					  	 	});
					  	
					  	} else if(data["updated"] != undefined) {

					  		var html = "<div data-alert class='alert-box'>"+data["updated"]["name"]+" was successfully saved<a href='#' class='close'>&times;</a></div>";
					  	 	$('form').prepend(html);
					  	 	$('.close').click(function(){
					  	 		$('.alert-box').remove();
					  	 	});
					  		new CCMAP('map-canvas',data["updated"]["legacy_event_id"],data["updated"]["latitude"],data["updated"]["longitude"],18).build(data["updated"]["id"]);
					  	} else {		
					  		var html = "<div data-alert class='alert-box'>"+data['name']+" was successfully saved<a href='#' class='close'>&times;</a></div>";
					  	 	$('form').prepend(html);
					  	 	$('.close').click(function(){
					  	 		$('.alert-box').remove();
					  	 	});
					  	 	
							$('html,body').animate({scrollTop: 0});
					  		$('form')[0].reset();

							new CCMAP('map-canvas',data["legacy_event_id"],data["latitude"],data["longitude"],18).build(data["id"]);
					  	}

			  		},
		  		error: function(){
		  			alert('500 error');
		 		}
			});  	
		}else{
			$.each(errorList,function(i,v){			
				$(v).parent().append("<small class='error'>can't be blank</small>") 
			})
		}
		return false;
	});
	
	var getErrors = function(){
		var list = [];
		$.each($("form input.required"),function(i,v){
			if (v.value == ''){list.push(v)}
		});
		return list;
	}

})
;
$(document).ready(function() {
  // TODO: refactor the map.
  var path = $(location).attr('pathname');
  var pathArray = path.split('/');
  var dashboard = pathArray[1] === 'admin';
  var page = pathArray[2];
  var elem = '.'+page;
  var worker_map = $('#worker-map-canvas').length

  if (dashboard){
    $('select').foundationSelect();
    $('.dashboard li').removeClass('active');
    $(elem).addClass('active');
    if ($(elem).parents('.has-dropdown').length) {
      $(elem).parents('.has-dropdown').addClass('active');
    }
  }
  // if a map is on the page get incident id
  if (worker_map !== 0) {
    var id = typeof $('.m-id.hidden')[0] !== 'undefined' ? $('.m-id.hidden')[0].innerHTML : 'none';
    var ccmap = new CCMap.Map({
      elm: 'worker-map-canvas',
      event_id: id,
      public_map: false,
      form_map: pathArray.indexOf('form') !== -1
    });
    // TODO: remove this once the worker map instantiation is setting the event correctly.
    ccmap.setEventId(id);
  }
});
